import React, { useState } from 'react';
import './App.css';
import { Route, Routes } from 'react-router-dom';
import { Login } from './Login/Login';
import { Signup } from './Signup/Signup';
import { Home } from './Home/Home';
import { Navbar } from './Navbar/Navbar';
import { Footer } from './Footer/Footer';

function App() {
  const [loginSiginin, setLoginSiginin] = useState(true);

  return (
    <div className="App">
      <Navbar loginSiginin={loginSiginin} />

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login setLoginSiginin={setLoginSiginin} />} />
        <Route path="/signup" element={<Signup setLoginSiginin={setLoginSiginin} />} />
      </Routes>
      <Footer />
    </div>
  );
}

export default App;
